import React from 'react'
import { Router as ReachRouter } from "@reach/router"

import { App } from './App';
import { Login } from './pages/Login';
import { Register } from './pages/Register';

export default function Router() {
  return (
    <ReachRouter>
      <App>
        <Login path="/login" />
        <Register path="/register" />
      </App>
    </ReachRouter>
  )
}
